import './App.css';

function MyButton() {
  function handleClick() {
    alert('You clicked me!');
  }

  return (
    <button onClick={handleClick}>
      Click me
    </button>
  );
}

export default function App() {
  return (
    <div>
      <h1 class="text-3xl font-bold underline">Hello world!</h1>
      <h1>Welcome to my app</h1>
      <MyButton />
    </div>
  );
}
